<!DOCTYPE html>
<html>
<head>
	<title>Electoral Division Health Profile </title>
</head>

<style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0 ;
        }

        header {
            background-color: #ffffff;
            color: #405381;
            padding: 10px;
            text-align: center;
        }

        nav {
            display: flex;
            justify-content: space-around;
            background-color: #405381;
            padding: 10px;
        }

        nav a {
            text-decoration: none;
            color: #ffffff;
            padding: 8px 16px;
            border-radius: 5px;
            transition: background-color 0.3s;
        }

        nav a:hover {
            background-color: #ccc;
        }
		     #main-header img {
        float: left;
        height: 80px;
        margin-right: 10px;
		
				     #main-header img {
        float: left;
        height: 80px;
        margin-right: 10px;
      }
    </style>


<body>

 <div>
        <header id="main-header">
          <img
            src="https://www.cso.ie/en/media/styleassets/images/granite/CSO_Logo_.png"
            alt="Central Statistics Office"
          />
          <h1>Electoral Division Health Profiles</h1>
        </header>

        <nav>
          <a href="./index.html" >Find on Map</a>
          <a href="./search.html" >Search by ED/AC/GUID</a>
          <a href="./rcode">Create Your Own Profiles (Code)</a>
        </nav>
      </div>
	<table id="table">
		<caption>Type in the search bar to the right to find an Electoral Division, Administrative County or ED GUID</caption>
	</table>
